import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

// import pages
import Obituary from './pages/Obituary';

function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route path='/' element={ <Obituary/> } />
        </Routes>
    </BrowserRouter>
  );
}

export default App;
